function supportsInterface(bytes4 interfaceId) public pure returns (bool) {
    // The original byte-level check preserved for logical fidelity.
    require(interfaceId == bytes4(uint32(interfaceId)), "Invalid interfaceId");

    // Pre-computed interface identifiers
    bytes4 constant ERC165_INTERFACE_ID              = 0x01ffc9a7;
    bytes4 constant ERC721_INTERFACE_ID              = 0x80ac58cd;
    bytes4 constant ERC721_ENUMERABLE_INTERFACE_ID   = 0x780e9d63;
    bytes4 constant ACCESS_CONTROL_INTERFACE_ID      = 0x7965db0b;

    return  interfaceId == ERC165_INTERFACE_ID            ||
            interfaceId == ERC721_INTERFACE_ID            ||
            interfaceId == ERC721_ENUMERABLE_INTERFACE_ID ||
            interfaceId == ACCESS_CONTROL_INTERFACE_ID;
}

